import React from 'react'
import { NavLink } from "react-router-dom";

export const LoggedIn = () => {
  return (
      <>
        <ul>
            <li><NavLink to="/">Logged</NavLink></li>
            <li><NavLink to="/about">In</NavLink></li>              
        </ul>
      </>
  )
}
